import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Alert, Platform, Pressable, StyleSheet, Text, TouchableHighlight, TouchableOpacity, View } from 'react-native';
import FlatListBasics from './Components/FlatList';

const STATUS_BAR_HEIGHT = Platform.select({ios:20, android:24});

const FridgeScreen = ({navigation}) => {

    return (
        <View style={styles.container}>
            <View style={{ height: STATUS_BAR_HEIGHT}} />
        <View style={styles.topBarContainer}>
          <Text style={styles.titleStyle}>Hladilnik</Text>
        </View>
        <View style={styles.mainContainer}>
          <FlatListBasics></FlatListBasics>
        </View>
        </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'transparent',
    alignItems: 'center',
    justifyContent: 'center',
  },
  topBarContainer:{
      flex:1,
      backgroundColor:"transparent",
      justifyContent:"center",
      alignItems:"center",
      borderBottomWidth:1
 },
 pressableStyle:{
     flex:1,
    alignItems:"center",
    justifyContent:"center",
    borderColor:"gray",
    borderWidth:1,
 },

 mainContainer:{
    flex:8,
    backgroundColor:'blue',
  },
  titleStyle: {
    fontSize: 20,
    textAlign:'center',
  },
});
export default FridgeScreen
